import { io } from "socket.io-client";

const url = "http://192.168.100.17:8000/";

const socket = io(url);

const SocketManager = {
  getSocket: () => socket,
};

const createRoom = (data) => {
    socket.emit("createRoom", data);
}

export default SocketManager;
